import React from "react";
import { FiSearch } from "react-icons/fi";
const Header = () => {
  return (
    <div className=" w-full items-baseline text-white fixed z-10 bg-gray-700 h-20">
      <div className=" pl-3  ">
        <div className="flex items-center">
          <div className="font-bold  w-20 ">MyPass</div>
          <div className="flex justify-start items-center">
            <textarea className=" rounded-lg py-1 text-center text-slate-500   resize-none h-8">
              Search
            </textarea>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
